private void pushTop() throws IOException {
  // call next() on each top, and put back into queue
  for (int i = 0; i < numTop; i++) {
    top[i].current = top[i].next();
    if (top[i].current != null) {
      queue.add(top[i]);
    }
  }
  currentOrd++;
  numTop = 0;
}

